// SPDX-License-Identifier: MIT
// In ERC721A
pragma solidity ^0.8.0;

//import '@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import './Logger.sol';

//Rarible has seperate smarts contracts called the Royalties Registry that is used to track/set the royalties of each NFT.
import "./@rarible/royalties/contracts/impl/RoyaltiesV2Impl.sol";
import "./@rarible/royalties/contracts/LibPart.sol";
import "./@rarible/royalties/contracts/LibRoyaltiesV2.sol";


contract INERC721A is ERC721A, Ownable, RoyaltiesV2Impl {
    //using Strings for uint256;
    
    string public baseURI;
    string _contractURI;
    bool _lazyMint;
    bool pause;
    uint256 countToken;
    //uint256 baseCollectionPrice;
    uint16 _maxMint;
    address addressLoger;
    bytes4 private constant _INTERFACE_ID_ERC2981 = 0x2a55205a;
    //bytes16 public baseExtension = ".json";

    constructor(string memory name, string memory symbol, string memory _initBaseURI, bool _lazy, address _addressLoger, uint16 __maxMint) ERC721A(name, symbol){
        setBaseURI(_initBaseURI);
        _lazyMint = _lazy;
        addressLoger = _addressLoger;
        _maxMint = __maxMint;
    }

    function getLazyMint() external view returns (bool){
        return _lazyMint;
    }

    function signatureWallet(address wallet, uint256[] memory _tokensId, uint256 _timestamp, bytes memory _signature) public pure returns (address){

        return ECDSA.recover(keccak256(abi.encode(wallet, _tokensId, _timestamp)), _signature);

    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721A) returns (bool) {
        if(interfaceId == LibRoyaltiesV2._INTERFACE_ID_ROYALTIES) {
            return true;
        }
        if(interfaceId == _INTERFACE_ID_ERC2981) {
            return true;
        }
        return super.supportsInterface(interfaceId);
    } 

    ///@dev for Opensea metadata
    function contractURI() public view returns (string memory) {
        return _contractURI;
    }

    ///@dev set metadata opensea
    function setContractURI(string memory _URI) external {
        _contractURI = _URI;
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setRoyalties(
        uint256 _tokenId,
        address payable _royaltiesReceipientAddress,
        uint96 _percentageBasisPoints
    ) public onlyOwner {
        LibPart.Part[] memory _royalties = new LibPart.Part[](1);
        _royalties[0].value = _percentageBasisPoints;
        _royalties[0].account = _royaltiesReceipientAddress;
        _saveRoyalties(_tokenId, _royalties);
    }

    function royaltyInfo(uint256 _tokenId, uint256 _salePrice)
        external
        view
        returns (address receiver, uint256 royaltyAmount)
    {
        LibPart.Part[] memory _royalties = royalties[_tokenId];
        if (_royalties.length > 0) {
            return (
                _royalties[0].account,
                (_salePrice * _royalties[0].value) / 10000
            );
        }
        return (address(0), 0);
    }

    ///@dev Temporarily lock the contract
    function paused() external onlyOwner {
        pause=!pause;
    }

    function mint(uint256 quantity) external onlyOwner {
        require(countToken+quantity<=_maxMint,"Up max mint");
        if(_lazyMint==false){
            _safeMint(msg.sender, quantity);
            Logger(addressLoger)._Mints(address(this),countToken,msg.sender, quantity,"ERC721A");
            countToken+=quantity;
        }
    }

    function lazyMint(uint256 quantity, address _to, uint256 idToken) external {
        if(_lazyMint==true){
            require(countToken+quantity<=_maxMint,"Up max mint");
            _safeMint(_to, quantity);
            Logger(addressLoger)._Mints(address(this),idToken,_to, quantity,"ERC721A");
        }
    }

    /**
    Burn a token (Useless for this project, but it's always good to have one)
     */
    function burn(uint256 tokenId) external onlyOwner {
        _burn(tokenId);
    }

    function exists(uint256 tokenId) external view returns (bool) {
        return _startTokenId() <= tokenId && tokenId < _currentIndex &&
            !_ownerships[tokenId].burned;
    }

    function _beforeTokenTransfers(
        address from,
        address to,
        uint256 startTokenId,
        uint256 quantity
    ) internal virtual override(ERC721A) {
        require(!pause, "Pausable: paused");
        super._beforeTokenTransfers(from, to, startTokenId, quantity);
        Logger(addressLoger)._Transfer(address(this), from, to, startTokenId, quantity, block.number,"ERC721A");
        // do stuff before every transfer
        // e.g. check that vote (other than when minted) 
        // being transferred to registered candidate
    }

}
